import React from 'react'
import {Text , StyleSheet , View , ScrollView , TextInput} from 'react-native'

const App = () => {
  return (
    <View>
     <Text style={Styles.container}> Hello World </Text>
    </View>
  )
}


const Styles = StyleSheet.create({
  container : {
    textAlign : 'center' ,
    fontSize  : '200px' ,
    color : 'red' ,
    opacity : '0.5'
  }
})

export default App
